import styles from './Arabica.module.scss';

export default function Arabica() {
    return(
    <main className={styles.Arabica}>
        <div className={styles.banner}>What Is Arabica Coffee?</div>
        <div className={styles.blurb}>Arabica coffee comes from the beans of a Coffea arabica plant, which originated in Ethiopia. Arabica is the world's most popular coffee type, equating to over 60% of cups drank. It's delicious</div>
    </main>
    )
}
